import React, { useState } from 'react'
import Card from './Card'

export default function SetList({}) {


    const sets = JSON.parse(localStorage.getItem('flashcardSets')) || []; // getting sets data in local storage

    const mapOfFirstSet = sets[0].cards;
    const mapOfSecondSet = sets[1].cards;


    return (
        mapOfSecondSet.map(item => {
            return <Card question={sets[0].name} />;
        })
    );

}
